import totalToRender from "./totalToRender"
import ProfileListItem from "./profileListItem"

// Extends ProfileListContainer //
export default function ProfileListContent(props) {

  return totalToRender(props.profileDataToRender, props.totalToRenderNumber).map((item, i) => (
    <ProfileListItem 
        key={`ListItem${i}`}
        style={props.style}
        data={item}
        setFocused={props.setFocused}/>
  ))
}
